import React from "react";

function Title(){
    const mode="احبششش";
    const status={
        user:1,
        admin:2
    }
    return(
    <div className="navbar bg-primary rounded ">
        <h1>{mode===1?status.user:status.admin}</h1>
        <h1>{5+3 }</h1>
    </div>
    )
  }

  export default Title;
